import React from 'react';

function Color(props) {
  const colorType = props.colorType;
  var colorName = "";
  if (colorType == "HEX") {
    colorName = props.colorNames.hex.toString();
  } else if (colorType == "RGB") {
    colorName = props.colorNames.rgb.toString();
  }
  return (
    <>
    <div className="color-item">
    <div className="color-chip" style={{backgroundColor:colorName}}
    onClick={props.function}>
    </div>
      <p className="color-name">{colorName.r}&nbsp;{colorName.g}&nbsp;{colorName.b}</p>
    </div>
    </>
  )
}
  export { Color };
